INSERT INTO `post_facebooks` VALUES ('9', '7', 'https://www.youtube.com/embed/IknZ6GPyIz8', null, '116321531736605_868964613138956', '2015-05-28 10:42:07', 'TRONG MÙA TUYỂN SINH 2015, KHU NHÀ Ở SINH VIÊN PHÁP VÂN - TỨ HIỆP PHỐI HỢP VỚI THÀNH ĐOÀN HÀ NỘI TỔ CHỨC HỖ TRỢ MIỄN PHÍ 2.500 CHỖ Ở CHO THÍ SINH VÀ PHỤ HUYNH DỰ THI ĐẠI HỌC, CAO ĐẲNG, KỲ THI QUỐC GIA, THI NĂNG KHIẾU… TẠI HÀ NỘI.\n\n Gía thuê: 205.000Đ/THÁNG \n 8 NGƯỜI/phòng. CÓ THỂ THUÊ THEO NHÓM BAO PHÒNG 1, 2 HAY 3... NGƯỜI TÙY THÍCH \n ĐIỆN, NƯỚC tính theo giá của NHÀ NƯỚC\n THANG MÁY hoạt động 24/24 \n Phòng có trang bị giường tầng, tủ đồ, bàn ghế học, BÌNH NÓNG LẠNH, phòng sinh hoạt chung... \n Có tầng hầm gửi xe (xe đạp: 30.000đ/tháng; xe máy: 60.000đ/tháng), INTERNET (khoảng 20.000đ/người/tháng – cáp quan 15MB)...\n Khu dịch vụ hỗ trợ tại tầng 1: nhà ăn, căng tin, bách hóa, văn phòng phẩm, cắt tóc, phòng tập thể thao đa năng (GYM, CẦU LÔNG, BÓNG RỔ…) AN TOÀN - SẠCH SẼ - GIÁ SINH VIÊN.\n\nNhờ bạn đăng thông tin hữu ích này lên page để cho nhiều bạn học sinh được biết nhé. Many thanks,\n\nMỘT SỐ HÌNH ẢNH GIỚI THIỆU VỀ KHU NHÀ Ở SINH VIÊN PHÁP VÂN – TỨ HIỆP:\nhttps://www.youtube.com/embed/IknZ6GPyIz8\n----------\nHotline: 0983 275 276\nwww.ktxphapvan.vn\nwww.facebook.com/ktxphapvan', null, '2016-11-08 09:23:27', '2016-11-08 09:23:27');
