INSERT INTO `post_facebooks` VALUES ('23', '13', 'https://www.facebook.com/permalink.php?story_fbid=441146059254149&id=116321531736605', null, '116321531736605_441146059254149', '2012-09-22 14:31:29', 'Cần một bác sĩ giỏi\n.....Để cứu lấy 1 trái tim sắp chết\nCần một thợ xây dựng\n.....Để xây lại những niềm tin\nCần người quét dọn\n......Để dọn đi những đổ vỡ\nCần một Gia Sư\n......Để học cách quên đi nhanh chóng\nCần một thám tử tư\n......Để tìm lại nụ cười đã mất\nNếu một người có thể làm hết những việc ấy thì xin hãy làm luôn việc cuối cùng đó là yêu thật lòng!!!', 'status', '2016-11-16 08:00:04', '2016-11-16 15:00:04');
INSERT INTO `post_facebooks` VALUES ('24', '13', 'https://www.facebook.com/permalink.php?story_fbid=438417782860310&id=116321531736605', null, '116321531736605_438417782860310', '2012-09-14 03:02:03', 'Thứ 7 tuần này (15/9/2012) sẽ tổ chức offline nhân dịp chào đón tân sinh viên nhập trường. Địa điểm và thời gian vẫn sẽ như năm ngoái. 16h00 tại cổng A sân vận động Mỹ Đình, để tránh tình trạng xé lẻ và delay gây khó chịu. Kính mong anh chị em đến đúng giờ như được thông báo.\n\nVậy, anh chị em nào đi được thì hãy đăng kí ở bên dưới. Lưu ý, ai có xe thì phải nói rõ để tiện sắp xếp kèm cặp những ai không có xe máy ở dưới này.\n\nVì đây là buổi gặp gỡ thân mật nên rất mong muốn nhận được sự ủng hộ của anh chị em trong Group THPT Việt Trì của chúng ta :)\n\nThân ái...\nnguồn : https://www.facebook.com/groups/163949473681335/', 'status', '2016-11-16 08:00:04', '2016-11-16 15:00:04');
INSERT INTO `post_facebooks` VALUES ('25', '13', 'https://www.facebook.com/permalink.php?story_fbid=424078890960866&id=116321531736605', null, '116321531736605_424078890960866', '2012-08-03 14:38:39', 'theo như thông lệ thì đầu năm học hội sẽ tổ chức 1 buổi offline chào tân sinh viên tốt nghiệp trường THPT Việt Trì, dự định sẽ tổ chức ở HN. kính mời tất cả các anh/chị/em k phân biệt tuổi tác vào cmt để bàn bạc về kế hoạch ^^\ndự là cuối tháng 9 sẽ tổ chức, nhưng bàn dần là vừa =))))))))))))))))) xem có ai hưởng ứng k ;))', 'status', '2016-11-16 08:00:04', '2016-11-16 15:00:04');
