INSERT INTO `post_facebooks` VALUES ('60', '15', 'https://www.facebook.com/permalink.php?story_fbid=544711975550400&id=539108949444036', null, '539108949444036_544711975550400', '2013-03-07 11:30:07', '#31 :Rất ấn tượng với tập thể lớp D08CN5 mặc dù em quen biết các anh chị chưa lâu ^^ Lớp nào mà vui dữ, toàn thành phần có khiếu tấu hài :))))) khá là đoàn kết nữa :)\nEm ấn tượng với cách các anh chị gọi nhau bằng những biệt danh ngộ nghĩnh =]]\n- Ấn tượng với các chị gái em đã từng gặp :\"> vì các chị nhìn ai cũng có nét duyên và đều khéo nấu :X\n- Anh Ngoạc lớp phó: thoạt nhìn ngoài đời rất lạnh lùng boy, nhưng trong ảnh thì ko hiểu sao nhìn cái nào em cũng mắc cười ko nhịn được >_< tếu...\n- Anh Hoàng Anh: em chưa biết biệt danh mà bạn a hay gọi a nhưng ấn tượng nhất cái khoản vẽ vời và đọc rap của a :))\n- Anh Xương: Bây giờ e mới thấu hiểu nguồn gốc cái biệt danh đấy của a :]] ấn tượng bởi cái tên đó vs cách nói chuyện cứ nửa đùa nửa thật. Hê hê..\n- Anh Trym: Anh tự đặt tên cho a à, khéo vậy, hợp quá đê =]] Cho đến bây giờ em vẫn thắc mắc làm sao ổng vẫn FA =.=\" mồm mép + pha trò thì thôi rồi.\n- Anh Vũ (Na): có vẻ nhiều ý tưởng :D vụ kinh doanh vẫn suôn sẻ chứ ạ? Là 1 người em thấy khá kỹ tính và làm việc j cũng rất nhiệt tình... ^^\n- Anh Sơn (xin phép bỏ qua cái biệt danh đằng sau ạ): :)) ấn tượng vì bạn gái anh xinh xắn :\"> hí hí hí\n- The Last One is Anh Tú KÍD : Luôn là đối tượng bị tăm tia chém gió nhiều nhất trong mỗi cuộc vui. :)) Lắm tài lẻ :P Tính cũng hay hay, rất thân thiện :D\nCòn nhiều nhiều anh chị nữa nhưng em chưa có cơ hội gặp mặt và chung vui :D Mong là sau này sẽ có dịp :)\nLời cuối, chúc các a c sớm có công việc và tình duyên như ý, luôn tươi trẻ, yêu đời và nhiều may mắn ^^!!!', 'status', '2016-11-16 08:00:05', '2016-11-16 15:00:05');
INSERT INTO `post_facebooks` VALUES ('61', '15', 'https://www.facebook.com/permalink.php?story_fbid=544334115588186&id=539108949444036', null, '539108949444036_544334115588186', '2013-03-06 16:10:10', 'Thế là bạn gái xinh nhất lớp mình đã lên xe hoa, nghe nói ngày xưa Oanh được rất nhiều chàng lớp mình thầm thương trộm nhớ, sao ko ai cf nhỉ =))', 'status', '2016-11-16 08:00:05', '2016-11-16 15:00:05');
INSERT INTO `post_facebooks` VALUES ('62', '15', 'https://www.facebook.com/permalink.php?story_fbid=544330182255246&id=539108949444036', null, '539108949444036_544330182255246', '2013-03-06 15:55:35', '#30 :.....nửa đêm nửa hôm, khó ngủ viết vô đây mấy dòng tâm trạng ngày xưa vậy ^_^\nT là 1 bạn nữ trong lớp mình, còn tên tuổi thế nào ít gạch thì sẽ khai mà lắm gạch là ém luôn =)))\nẤn tượng đầu tiên vào lớp là t rất là ghét lớp mình...vì t chả nói chuyện đc vs ma nào hết. Ghét nhất là phó Bình vì cái mặt trông khó đăm đăm tiếp đến là GATO vs cả 1 list các bạn nữ đc rất nhiều các bạn nam ái mộ như Hà, Ánh, Thu, Kun\'... ghét kiểu vênh vênh của Vũ vs Hoàng Anh. mịa...học cùng lớp mà tụi nó éo bít mình là ai chào cũng éo đứa nào thèm bảo sao, thấy mà GHÉT >\"<...ghét kiểu Tú KID con trai j mà suốt ngày đỏm dáng mặc dù là..cũng khá đập trai :\"> ...vs cả ghét vì thi rớt ĐH =((\nThiện cảm ah... ít lắm... có Nghĩa béo thoai, con này bắt chuyện dễ, nc khá hợp gu vs cả Cúc, cô bạn hiền khô ở Ninh Bình đứa đầu tiên hẹn hò về quê mang quà lên cho mình và kết quả là....nó làm thật :X ah, vs cả Tuấn với bài \"MẶT DĂNG MẶT DỜI\"... mà chả biết ai còn nhớ k :-??\n...........................vậy đấy năm nhất của mình trôi đi chỉ với toàn GHÉT BỎ và GATO =))))))))))\nNhưng r mọi chuyện đã thay đổi từ hè năm Nhất.... tự nhiên trên trời rơi xuống có cả nhóm bạn thân Vũ Bình Phước Nghĩa Tuấn...đi chơi tối ngày k hết.......r vào năm 2 tự nhiên thấy yêu lớp mình thế. Mấy đứa mình ghét tiếp xúc r thấy nó k đáng ghét như mình nghĩ, trc ghét bnhieu sau lại thân bấy nhiêu ^^ mấy bạn mình GATO thì thấy cũng bt hẳn đi <kiểu bjo cũng có ng chơi vs r nên hết ghen tị ấy :\">...\nNăm nhất cày đầu học mà học vẫn ngu năm 2 chả học tự nhiên phẩy lại lên ầm ầm...đang chả đc ma nào ngó tới thì tự nhiên ngày nào lên lớp cũng đc dồn cả đống quan tâm do bị trêu vs phó Ngọc :))) hô hô...cái thằng mà mình thấy xấu dai mà hài ước nhất quả đất ! và r trong các kì thi tiếp theo lại thành Sờ ta của lớp nữa chứ <cứ ôn thi là các bạn lại kéo tới ầm ầm hỏi bài..nghĩ lại thấy thích ơi là thích, vui cực luôn ^^> Cái tính hóng hớt ém lâu này thì có cơ hội phát triển ngày càng cao và từ 1 con tự kỉ đã trở thành 1 con có độ hóng tốt chả mấy khi thiếu mặt trong vụ chơi bời nào của lớp..... Nói đến đây hẳn ai cũng biết t là ai r...t chỉ muốn nói là sau thời gian 4,5 năm Đh t vẫn nhớ và nhiều kỉ niệm về lớp lắm ^^ hê hê...', 'status', '2016-11-16 08:00:05', '2016-11-16 15:00:05');
INSERT INTO `post_facebooks` VALUES ('63', '15', 'https://www.facebook.com/permalink.php?story_fbid=486197891440259&id=539108949444036', 'https://external.xx.fbcdn.net/safe_image.php?d=AQD_GwPS1h7UtuLs&w=130&h=130&url=http%3A%2F%2Fstatic.mp3.zing.vn%2Fskins%2Fmp3_v3_16%2Fimages%2Favatar_default_82x82.jpg&cfs=1', '539108949444036_486197891440259', '2013-03-03 10:04:43', '#29 : Tớ xin lỗi các bạn vì đang mang tên các bạn ra làm niềm vui của tớ… Sau đây là sự tích về những cái tên…\n- Tớ xin lỗi bạn Long, cái tên Fox thực ra là nó bằng nguồn rất dài cơ, bắt đầu là từ Sách rồi bắt Sóc rồi thành Phóc loằng ngoằng 1 hồi thì thằng bạn nó cho ra Phốc... tớ xin lỗi nếu nó làm bạn buồn, nhưng nó là 1 chuỗi năm tháng kỉ niệm ae chung sống cùng nhau dưới một mái nhà =))~\n- Tớ xin lỗi bạn Hưng, cái tên XƯƠNG nguồn gốc của nó cũng khá dài mà rất nhiều kỉ niệm. Bắt đầu là chuyện tình dưới háng... bạn đã thể hiện tình yêu của mình bằng cách im lặng, nó quá mới so với giới trẻ hồi đó họ ko thể hiểu được và từ đó bạn xưng vương thành NE VỜ CỬNG... tiếp bạn sắm ngay cho mình con ngựa trắng ko những thế tay bạn còn cầm mẩu thần, và hồi đó dân gian gọi bạn với cái tên là BẠCH CÔNG CỬNG. Sau đó là hàng trăm ngày bạn khuấy đảo giang hồ bằng thứ vũ khí thượng cổ, cái tên được vang lên khắp giang sơn cờ nờ năm MẨU XƯƠNG. Những năm tháng cuối đờ hờ bạn tỏ ra cho mọi người thấy mình thật sự với cái tên MẨU XƯƠNG DỄ THƯƠNG, và rồi mọi người đều kêu vs tiếng thân thương là XƯƠNG.\n- Tớ xin lỗi bạn Tú, tớ đã chuyển thể cái tên đẹp đẽ của bạn từ kít sang ít rồi thêm đ xong cuối cùng nó lại thành bã luôn. Và rồi :poop: đã được công đồng phây búc hưởng ứng rất tốt bỏ qua luyện và 1 cơ số vãi khác. CƯỚC.\n- Tớ xin lỗi bạn Việt, bạn là sinh viên có gương mặt khả ái học 2 trường đại học với biệt tài chơi giun, con của bạn điều khiển ko bjo đâm vào đýt. Hồi trẻ trâu cái thời nhật ký vàng anh, cũng dùng cái tên của nam diễn viên chính đặt cho bạn, nhưng rồi thời gian nhạt nhào đã làm hình bóng đó phai dần... NÁT\n- Tớ xin lỗi bạn Hải, Cái thời mà ngôn ngữ teen lên ngôi \"i\" đổi thành \"y\" dài rồi loạn xì nhầu lên \"ch\" vs cái \"tr\" cũng chả phân biệt được luôn. TRYM ra đời từ đó trờ NẶNG và y DÀI\n- Tớ xin lỗi bạn Thông, cái giới hành trên toàn thế giới này đều biết đến biệt danh CÙI chứ ko phải @@s\n- Tớ xin lỗi bạn Phước, một buổi đêm khá đẹp trên bờ hồ con rùa, bạn giao tiếp khá là tốt với người nước ngoài thể hiện độ nhiệt tình và hiếu khách của chúng mình. PHẮC ra đời từ đấy, sau đó là hang loạt tín đồ lên ngôi kiểu PHÍCH nhiều PHÚC rồi PHỌT ra cả PHẸT nữa. Nhưng PHẮC vẫn khẳng định mình là thương hiệu.\n- Tớ xin lỗi bạn Bình, hồi đầu bỡ ngỡ bước vào trường đại học và tuần lễ công dân tớ khá giật mình khi gặp bạn. Bạn khá giống với 1 cô tớ quen, có vẻ “dừ” nhất trong giới trẻ hồi đấy. Và tiếp đó 1 khoảng thời gian, giang hồ đồn đại rất nhiều thứ tệ hại về bạn mình cũng chẳng ghét bạn nhiều lắm, chỉ nhìn khó ưa thêm 1 tí tẹo tèo teo thôi. Và tình cờ mình quen biết, rồi mình nghĩ bạn đã tốt hơn lên, trẻ dần và phát triển thế mạnh về những cái nhìn từ phía sau. Mình nghĩ thương hiệu LACOSTE phải trả tiền tên thương hiệu nhiều cho bạn.\n- Tớ xin lỗi bạn Hà, bạn là người làm tớ hơi giật mình vì lời chúc mừng sinh nhật năm đầu vào đại học luôn vào khoảng 00h-02m-34s ngày ấy. Hồi đấy trong mắt tớ thì, bạn cũng học 2 trường đại học nói chuyện dễ thương hơi nhiều râu chút xíu có thể vì thế mà câu chuyện từ miệng bạn kể cũng lợi hại ra phết, nghe rất thú vị. Nhưng cũng chả nghĩ ngợi gì nhiều hơn, giờ mới nghĩ ko biết bạn có ý đồ gì ko?” Tiếc là thời gian đấy trôi qua quá nhanh, nói chuyện với nhau cũng nhiều hơn rõ ràng cũng súp pờ soi nhiều hơn. Cô “râu” ngày xưa dễ thương là thế nhưng càng nhìn từ trên xuống thật kĩ thật kĩ thì đỉnh đầu bạn ấy sáng cực, chói lòa hơn khi để ánh nắng xuyên qua lớp tóc. HÓI chắc từ đó là đủ.\n- Tớ xin lỗi bạn Hương, hồi đầu từ bạn toát lên vẻ rất thân thiện của một thiếu nữ thôn quê, nó rất dễ chịu với một trai quê như tớ. Sau một thời gian từ cái miệng lợi hại quá tớ bạn đã được gán ghép với bạn Ngọc phó, tứ lúc đó mỗi lần bạn vào lớp bạn có cảm thấy mình đang được bay ko? Rồi cái con GÀ là sự xuất hiện hết sức trùng hợp trong bài animation nhỉ !?\n- Tớ xin lỗi bạn Nghĩa, hồi đầu cảm nhận của tớ về bạn cũng giống bạn Hương hơn nữa còn là 1 người biết lo toan cho gia đình. Ú cái tên từ thân mình doremon của bạn.\n- Tớ xin lỗi bạn Ngọc, lớp phó đầy tài năng và quyền lực. Bạn khá cá tính trong mọi chuyện, cái miệng có vẻ là thứ vũ khí lợi hại. Ngày ấy chính cái miệng đấy tớ được nghe kể là với 59 cái lỗ thâm hậu bạn đã vô địch trong kì thi nhả chữ. Rồi trong 1 cuộc ẩu đả về ngôn ngữ, TRIBU được khai quật. Mình cũng định học thần công miệng nhưng do quá nóng vội để luyện thành thần công nên đã bị tẩu hỏa nhập ma và gọi cái tên úy nhả bã của bạn thành NGOẠC.\n- Tớ xin lỗi bạn Sơn, ngày trước thế éo thế éo nào có khi lúc đầu bạn là thằng tớ ngứa mắt nhất. Thì đã bảo rồi, ngứa của nào trời cho rất ngứa, rồi chơi với nhau thấy cũng chả có vị gì ngoài tính hiếu thắng hơn người. Chắc cũng do nó và dòng đời xô bạn vào bến bờ toàn bãi dù có nhiều người đến cứu bạn. CHÓ cái tên nó là sự xúc phạm của loài động vật gần gũi nhất với người.\n- Tớ xin lỗi tất cả các bạn của tớ, vì ai tớ cũng cho dính thêm chữ chó ở sau lưng… bạn nào còn xót thì com mừn để tớ xin tiếp lỗi =))~ =))~ =))~ Chúc các bạn cuối tuần vui vẻ ^_^\nhttp://mp3.zing.vn/bai-hat/To-Xin-Loi-cnluvcn/IW68F7B7.html', 'video', '2016-11-16 08:00:05', '2016-11-16 15:00:05');
