INSERT INTO `post_facebooks` VALUES ('66', '15', 'https://www.facebook.com/permalink.php?story_fbid=542161732472091&id=539108949444036', null, '539108949444036_542161732472091', '2013-03-02 14:46:18', 'hôm nay nhiều cf quá :))))))))))))\n#24 : t ko thích bạn trym vì bạn có rất nhiều tội với t . thứ 1 : hay trêu t với 1 bạn , làm t rất ngại mỗi khi chạm mặt với bạn ấy. thứ 2 : bạn ý dám bảo t c r v c b h\n \n#25 : Ngày xưa tớ thần tượng bạn Việt cực, trông mặt thì ngu ngu mà học tận 2 trường đại học. Ngày ấy tớ thấy bạn chơi giun rất giỏi, cái con của bạn ấy dài cực chả bao giờ thấy bạn đấy đâm vào đýt mà chết...\n=)))))))))))))))))))))))))))))))))))))))))))))))))))))))))))))', 'status', '2016-11-16 08:00:05', '2016-11-16 15:00:05');
