INSERT INTO `post_facebooks` VALUES ('68', '15', 'https://www.facebook.com/permalink.php?story_fbid=542082242480040&id=539108949444036', null, '539108949444036_542082242480040', '2013-03-02 10:47:57', '#22: Mình nói thật đã rất nhiều lần mình đứng thần người ngắm bạn Bình rất lâu khi bạn ấy ngồi ở cửa sổ nhìn xa xăm .... Mình thấy cái gì đó bí ẩn khó gần .... Ko dàm tiến lại gần ... Cng ko mún rời mắt .... Chỉ thấy to mò về 1 con người huyền bí lạnh lùng và đầy quyền lực ... Và quả thật Bình đẹp ... Rất đẹp ... Khi nhìn từ sau lưng !\np/s: @bình có nhiều fan qá:))', 'status', '2016-11-16 08:00:05', '2016-11-16 15:00:05');
INSERT INTO `post_facebooks` VALUES ('69', '15', 'https://www.facebook.com/permalink.php?story_fbid=541760085845589&id=539108949444036', null, '539108949444036_541760085845589', '2013-03-01 15:57:12', '#21 :mình đã từng thích bạn Trang, giờ hết thích rồi vì bạn ấy về quê mất rồi. Nhưng đó là 1 cuộc tình rất chi là trẻ con vì giờ mình nghĩ khác so với lúc đấy rồi :))', 'status', '2016-11-16 08:00:05', '2016-11-16 15:00:05');
INSERT INTO `post_facebooks` VALUES ('70', '15', 'https://www.facebook.com/permalink.php?story_fbid=541723562515908&id=539108949444036', null, '539108949444036_541723562515908', '2013-03-01 13:51:24', '#20 :Thú thật là t không có nhiều kỷ niệm với lớp, thấy học đại học cũng bình thường, quan hệ bạn bè cũng bình thường, trong những cuộc vui hình như mọi người vẫn cảnh giác với nhau, nói chung là không vui cho lắm. Đi học cũng ấn tượng với 1 vài bạn nữ, nhưng chắc chắn các bạn ấy ko hề để ý đến mình :)), các bạn nữ chỉ nói chuyện ,pm yahoo khi có việc cần nhờ .Các bạn nữ có bạn thì vẫn như năm đầu, có bạn thì càng ngày càng nhí nhảnh (vì là page confess nên t nói thật suy nghĩ :D) nhưng mà ấn tượng đầu tiên bao giờ cũng khó phai nhạt nhất. Ví dụ như bạn hương, giờ bạn rất là hàn quốc hàn xẻng, nhưng mà mỗi khi nhìn thấy bạn ấy t toàn nghĩ đến hồi năm nhất bạn đeo kính rất chân chất và lúc nào cũng khó đăm đăm ..tớ còn nhớ hồi đầu năm bạn ấy nhất định tắt quạt trong khi các bạn nữ ngồi bàn trên kêu nóng thảm thiết...nhưng có thế nào các bạn nữ lớp mình vẫn rất đáng yêu, t rất khâm phục bạn Nga vì bạn ấy chưa bao giờ gian lận thi cử (theo t biết) và bạn ấy cũng sẵn sàng giúp đỡ các bạn khác', 'status', '2016-11-16 08:00:05', '2016-11-16 15:00:05');
INSERT INTO `post_facebooks` VALUES ('71', '15', 'https://www.facebook.com/permalink.php?story_fbid=541277432560521&id=539108949444036', null, '539108949444036_541277432560521', '2013-02-28 13:35:37', '#17: Đây là cảm nhận của tớ khi mới vào lớp (năm đầu):\nẤn tượng ban đầu với bạn Hà hói : ưa nhìn, gu thời trang khá ổn, mặt khôn khôn - chắc do trán bạn í quá cao so với bình thường, mà các cụ ta thường định nghĩa là HÓI ^^!Bị quí bạn í, vì bạn rất được nhiều các bạn trai trong lớp ưa thích...\nTiếp theo, người mà năm đầu mình khá anti đó là bạn Bình lớp phó :P. Tự hỏi, sao hồi xưa bạn í xấu tính và ích kỉ thế :)). Và Mạnh - 1 anh bạn lầm lì và cũng hơi khó ưa nốt =)). Và cái gì phải đến rồi cùng đến, 2 người họ yêu nhau (lúc đó nghĩ : \"nồi nào úp vung nấy\" =)). Chẳng hiểu sao, họ yêu nhau và trở thành những con người hoàn hảo hơn, thế mới tài. Đúng là sự trớ trêu của cuộc sống và rồi tớ lại quí họ :)) -> phát hiện ra quy luật của cuộc sống : 2 người xấu yêu nhau sẽ trở nên đẹp đẽ hơn bao giờ hết :v', 'status', '2016-11-16 08:00:05', '2016-11-16 15:00:05');
