INSERT INTO `post_facebooks` VALUES ('78', '9', 'http://khactung.com/knowledge/phan-43-bay-nguoc/', null, '585045091618736_965042710285637', '2016-10-05 14:18:00', 'Cánh cửa gỗ bật mở, trước mặt anh là một người đàn ông trông khá kỳ lạ với vết sẹo trên mặt. Nhưng điều làm anh ngạc nhiên nhất không phải là bởi hình dáng kỳ lạ của người đàn ông. Điều kỳ lạ là người đàn ông đó đang mỉm cười với anh. Đứa cháu gái lao vội từ phía trong căn nhà ra ôm chầm lấy anh, Roller lặng lẽ bước vào trong ngôi nhà và ngồi lên chiếc ghế da kiểu cổ được đặt cạnh chiếc lò sưởi cũng trông cổ kính không kém. [  737 more words ]\n\nhttp://khactung.com/knowledge/phan-43-bay-nguoc/', null, '2016-11-08 10:40:04', '2016-11-08 10:40:04');
INSERT INTO `post_facebooks` VALUES ('79', '9', 'http://khactung.com/knowledge/phan-41-nguoi-ban-cu/', null, '585045091618736_916012948521947', '2016-08-09 08:12:42', 'Không phải lúc để Roller do dự, Anh vội vã đến đón Kai và lao đến địa chỉ trong tin nhắn. Anh thấy một cảm giác bất an đeo đuổi phía sau mình. Mới đó mà trời đã trở nên tối thẫm, những đợt mây đen vần vũ phía xa báo hiệu một cơn mưa lớn đang dần tới. Địa chỉ trong tin nhắn thuộc ngoại ô thành phố, cách nơi ở của Roller khá xa. [  803 more words. ] \n\nhttp://khactung.com/knowledge/phan-41-nguoi-ban-cu/', null, '2016-11-08 10:40:04', '2016-11-08 10:40:04');
INSERT INTO `post_facebooks` VALUES ('80', '9', 'http://khactung.com/knowledge/kinh-nghiem-tuyen-sinh-cua-amazon/', null, '585045091618736_907391022717473', '2016-07-28 16:35:06', 'Tuần qua, Timothy Metcalf, một người quản lí của công ty Amazon đến gặp tôi và chia sẻ với tôi về loại sinh viên mà anh muốn thuê: “Ngày nay đa số công ty đều có cuộc phỏng vấn kỹ thuật để kiểm điểm kĩ năng của sinh viên vừa tốt nghiệp. Nhiều sinh viên phần mềm tin rằng phỏng vấn kĩ thuật chỉ bao gồm việc viết mã nhưng đó là nhận thức sai. [  2304 more words. ] \n\nhttp://khactung.com/knowledge/kinh-nghiem-tuyen-sinh-cua-amazon/', null, '2016-11-08 10:40:04', '2016-11-08 10:40:04');
INSERT INTO `post_facebooks` VALUES ('81', '9', 'http://khactung.com/knowledge/du-lich-quan-lan-minh-chau/', null, '585045091618736_901475499975692', '2016-07-19 13:29:36', 'Mình vừa đi Minh Châu, Quan Lạn vào đầu tuần. Và mình thấy mãn nguyện với sự lựa chọn, công sức cũng như tiền bạc bỏ ra. Bây giờ mình sẽ chỉ cho các bạn chi tiết nhất lộ trình đi Minh Châu, Quan Lạn khởi hành từ Hà Nội. Trong bài viết này 100% ảnh đều là tự mình chụp trong chuyến đi vừa qua. [  1435 more words. ] \n\nhttp://khactung.com/knowledge/du-lich-quan-lan-minh-chau/', null, '2016-11-08 10:40:04', '2016-11-08 10:40:04');
