INSERT INTO `post_facebooks` VALUES ('150', '29', 'http://khactung.com/develop/list-status-codes-requests-http/', null, '585045091618736_969156133207628', '2016-10-11 06:08:55', 'The values of the numeric status code to Hypertext Transfer Protocol (HTTP) requests is the data sections of messages Status, Error, Forward and Redirect responses is usefull for developer. It help developer can be diagnostic information and resolve their issues Summary codes: 1xx: Informational - Request received continuing process 2xx: Success         - The action was successfully received understood and accepted… [  186 more words ]\n\nhttp://khactung.com/develop/list-status-codes-requests-http/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('151', '29', 'http://khactung.com/knowledge/phan-43-bay-nguoc/', null, '585045091618736_965042710285637', '2016-10-05 14:18:00', 'Cánh cửa gỗ bật mở, trước mặt anh là một người đàn ông trông khá kỳ lạ với vết sẹo trên mặt. Nhưng điều làm anh ngạc nhiên nhất không phải là bởi hình dáng kỳ lạ của người đàn ông. Điều kỳ lạ là người đàn ông đó đang mỉm cười với anh. Đứa cháu gái lao vội từ phía trong căn nhà ra ôm chầm lấy anh, Roller lặng lẽ bước vào trong ngôi nhà và ngồi lên chiếc ghế da kiểu cổ được đặt cạnh chiếc lò sưởi cũng trông cổ kính không kém. [  737 more words ]\n\nhttp://khactung.com/knowledge/phan-43-bay-nguoc/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('152', '29', 'http://khactung.com/knowledge/phan-41-nguoi-ban-cu/', null, '585045091618736_916012948521947', '2016-08-09 08:12:42', 'Không phải lúc để Roller do dự, Anh vội vã đến đón Kai và lao đến địa chỉ trong tin nhắn. Anh thấy một cảm giác bất an đeo đuổi phía sau mình. Mới đó mà trời đã trở nên tối thẫm, những đợt mây đen vần vũ phía xa báo hiệu một cơn mưa lớn đang dần tới. Địa chỉ trong tin nhắn thuộc ngoại ô thành phố, cách nơi ở của Roller khá xa. [  803 more words. ] \n\nhttp://khactung.com/knowledge/phan-41-nguoi-ban-cu/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('153', '29', 'http://khactung.com/knowledge/kinh-nghiem-tuyen-sinh-cua-amazon/', null, '585045091618736_907391022717473', '2016-07-28 16:35:06', 'Tuần qua, Timothy Metcalf, một người quản lí của công ty Amazon đến gặp tôi và chia sẻ với tôi về loại sinh viên mà anh muốn thuê: “Ngày nay đa số công ty đều có cuộc phỏng vấn kỹ thuật để kiểm điểm kĩ năng của sinh viên vừa tốt nghiệp. Nhiều sinh viên phần mềm tin rằng phỏng vấn kĩ thuật chỉ bao gồm việc viết mã nhưng đó là nhận thức sai. [  2304 more words. ] \n\nhttp://khactung.com/knowledge/kinh-nghiem-tuyen-sinh-cua-amazon/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('154', '29', 'http://khactung.com/knowledge/du-lich-quan-lan-minh-chau/', null, '585045091618736_901475499975692', '2016-07-19 13:29:36', 'Mình vừa đi Minh Châu, Quan Lạn vào đầu tuần. Và mình thấy mãn nguyện với sự lựa chọn, công sức cũng như tiền bạc bỏ ra. Bây giờ mình sẽ chỉ cho các bạn chi tiết nhất lộ trình đi Minh Châu, Quan Lạn khởi hành từ Hà Nội. Trong bài viết này 100% ảnh đều là tự mình chụp trong chuyến đi vừa qua. [  1435 more words. ] \n\nhttp://khactung.com/knowledge/du-lich-quan-lan-minh-chau/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('155', '29', 'http://khactung.com/develop/javascript-get-location-browser/', null, '585045091618736_888438817946027', '2016-06-27 07:10:18', 'The browser support the Navigator object. We can get location of browser by the Geolocation property in Navigator object. The Geolocation property supported in browser: IE: IE9 versions or than. Chrome: 5.0 versions or than. Firefox: 3.5 versions or than. Safari: 5.0 versions or than. Opera: 16.0 versions or than. Below demo will returns a Geolocation object that can be used to locate the you position: [  49 more words. ] \n\nhttp://khactung.com/develop/javascript-get-location-browser/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('156', '29', 'http://khactung.com/knowledge/y-nghia-vi-tri-hon-tren-co/', null, '585045091618736_888396611283581', '2016-06-27 04:37:50', 'Trên cơ thể con người có nhiều vị trí hôn, mỗi vị trí ứng với một kiểu hôn, cách thức hôn khách nhau. Trẻ con thời nay được bố mẹ dạy hôn rất nhiều như hôn vào má, vào môi. Nhưng phải cho chúng biết hôn như nào là đúng thì ko phải ai cũng biết. Việc này dần dần sẽ hình thành thói quen của trẻ. [  161 more words. ] \n\nhttp://khactung.com/knowledge/y-nghia-vi-tri-hon-tren-co/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('157', '29', 'http://khactung.com/develop/tim-hieu-ve-dieu-hanh-kali-linux/', null, '585045091618736_874306669359242', '2016-06-02 11:22:48', 'Ở phần đầu tiên trong chuyên mục tìm hiểu về Hacker. Các bạn hãy tìm hiểu về hệ điều hành Kali linux, một hệ điều hành được nhiều chuyên gia bảo mật cũng như Hacker sử dụng nhé. Kali linux chứa đựa hơn 200 công cụ hack và kiểm tra bảo mật nổi tiếng tiến hóa từ BackTrack Trong những năm qua BackTrack là hệ điều hành được sử dụng nhiều nhất bởi các chuyên gia đánh giá bảo mật. [  1446 more words. ] \n\nhttp://khactung.com/develop/tim-hieu-ve-dieu-hanh-kali-linux/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('158', '29', 'http://khactung.com/knowledge/phan-41-nguoi-ban-moi/', null, '585045091618736_874303712692871', '2016-06-02 11:13:52', 'Roller vội vã trở về căn nhà của mình. Kai vừa bị tấn công, có thể nào nơi chú ẩn của chú cháu nó đã bị. Đưa cháu gái đang ở nhà có thể sẽ gặp nguy hiểm nếu như thực sự dấu vết của Roller đã bị những kẻ trên mạng cục bộ truy lùng ra được. Nhưng không thể nào. [  566 more words. ] \n\nhttp://khactung.com/knowledge/phan-41-nguoi-ban-moi/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('159', '29', 'http://khactung.com/develop/php-get-type-file-function/', null, '585045091618736_872720066184569', '2016-05-30 14:18:43', 'PHP is language for webserver, it support very more functions. With file, PHP also support very more function, full for you can code everything . You can refer to library of PHP. Here, I am referring to how to get the type of files a simple way: $extension = pathinfo($file_name, PATHINFO_EXTENSION); Hope, it helpful to you.\n\nhttp://khactung.com/develop/php-get-type-file-function/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('160', '29', 'http://khactung.com/develop/magento-code-change-password-user-admin/', null, '585045091618736_850505171739392', '2016-04-23 07:17:01', 'Magento code change password user admin In anyday, you unable to log in to Magento system. Don\'t worry, you don’t remember but you still can reset your admin password. You are a Magento developer and want a quick and easy way to set an admin account password by code. You need add below code to PHP file at anywhere: <?php require_once(\'app/Mage.php\'); //Path to Mage Magento umask(0); Mage::app(); //set password following username, below demo with username: khactung Mage::getModel(\'admin/user\')->loadByUsername(\'khactung\')->setPassword(\"123456\")->save(); echo \"Successfully Changed\"; ?> [  28 more words. ] \n\nhttp://khactung.com/develop/magento-code-change-password-user-admin/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('161', '29', 'http://khactung.com/develop/magento-rename-table/', null, '585045091618736_850489855074257', '2016-04-23 06:53:50', 'Magento rename table Rename database tables could make manually through a tool like phpMyAdmin or softwares, but because a default Magento install counts over 200 tables, this issue is better performed by using a PHP-script. Add the below code to a PHP file //create table $installer = $this; $installer->startSetup(); $installer->getConnection()->renameTable(\'old_table\', \'new_table\'); $installer->endSetup(); Thanks for watching!\n\nhttp://khactung.com/develop/magento-rename-table/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('162', '29', 'http://khactung.com/develop/magento-rewrite-controllers-enterprise_importexport/', null, '585045091618736_850484958408080', '2016-04-23 06:28:29', 'Magento rewrite controllers Enterprise_ImportExport All project I was joined are using rewrite block, model, helper or controllers. We need to change something, to add something new or to override something in core of Magento. Magento supported method way how to overwrite those these files. And with Enterprise version, today I will demo rewrite a controllers: Enterprise_ImportExport_Adminhtml_Scheduled_OperationController Step 1: create OperationController.php controller file with content: [  92 more words. ] \n\nhttp://khactung.com/develop/magento-rewrite-controllers-enterprise_importexport/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('163', '29', 'http://khactung.com/develop/magento-send-mail-attach-file/', null, '585045091618736_850477945075448', '2016-04-23 05:55:48', 'Hi everyone, Today I share code to send mail attach file in Magento. Magento supported functions about mail for user and coder can easy to manipulate, config and custom these funstions Before, we need look back Email Addresses config of Magento: Here, I will use General Contact ($mailSender and $nameSender) Code below: /* * send file to mail * */ public function sendEmail($error = NULL) { $to_email_arr[] = array( \'tungnk.hn@gmail.com\', \'mail2@gmail.com\', ); $to_name_arr[] = \'KhacTung\'; //get sender mail and sender name default from System Magento $mailSender = Mage::getStoreConfig(\'trans_email/ident_general/mail\'); $nameSender = Mage::getStoreConfig(\'trans_email/ident_general/name\'); $mailTemplate = Mage::getModel(\'core/email_template\'); $mailTemplate->setSenderName($nameSender); $mailTemplate->setSenderEmail($mailSender); $mailTemplate->setTemplateSubject(\'KhacTung Test Attach Mail\'); $mailTemplate->setTemplateText(\'Content Test\'); // add attachment $mailTemplate->getMail()->createAttachment( file_get_contents(Mage::getBaseDir(\'base\') . [  46 more words. ] \n\nhttp://khactung.com/develop/magento-send-mail-attach-file/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('164', '29', 'http://khactung.com/develop/user-logs-one-machine-time/', null, '585045091618736_850464078410168', '2016-04-23 05:03:28', 'A user logs in from one machine at a time Guide and demo: Set a key in your session that you store in the database in the user table: Table User: - user_id - username - password - token On Login: - Create random token, set for that user in database and create a session have value is that token: [  196 more words. ] \n\nhttp://khactung.com/develop/user-logs-one-machine-time/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('165', '29', 'http://khactung.com/develop/code-get-number-day-month/', null, '585045091618736_850452488411327', '2016-04-23 04:24:51', 'Share for everyone code get number day of a month. Below, I code with PHP. Format number of the day: start from 0 -> Sunday, end at 6 -> Satuday 0 - Sunday 1 - Monday 2 - Tuesday 3 - Wednesday 4 - Thursday 5 - Friday 6 - Satuday /* *$start format: yyyy-mm-dd *$end format: yyyy-mm-dd */ public function numberDayInMonth($start, $end) { $dayInWeek = array(1, 2, 3, 4, 5, 6, 0); foreach($dayInWeek as $indexDay){ $result[$indexDay] = 0; } $start = strtotime($start); $end = strtotime($end); //get interval day from param $start and $end $intervalDay = (int)($end - $start)/86400; //for each day for($i = 0; $i <= $intervalDay; $i++) { $w = date(\"w\", $start); //$w: format number of day //set total number of day if(isset($result[$w])){ $result[$w] +=1; }else{ $result[$w] =1; } //increase start day $start = strtotime(\"+1 day\", $start); } return $result; } //show result Array ( [1] => 5 [2] => 4 [3] => 4 [4] => 4 [5] => 4 [6] => 4 [0] => 4 ) Thanks for watching!\n\nhttp://khactung.com/develop/code-get-number-day-month/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('166', '29', 'http://khactung.com/develop/add-git-to-console-2/', null, '585045091618736_850444125078830', '2016-04-23 04:01:11', 'I was used Console2. Not only can it display a regular command prompt and PowerShell in tabs (as he describes), any console process can be added. msysgit users can add Git Bash to by opening the Settings dialog and adding a tab with the following properties: Shell: C:\\Windows\\SysWOW64\\cmd.exe /c \"\"C:\\Program Files\\Git\\bin\\sh.exe\" --login -i\" Startup dir: D:\\khactung\\Project After: click to ok and reload Thanks for watching!\n\nhttp://khactung.com/develop/add-git-to-console-2/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('167', '29', 'http://khactung.com/knowledge/muc-luong-develop-nam-2016/', null, '585045091618736_850436715079571', '2016-04-23 03:42:17', 'Mức lương develop năm 2016 Theo nhiều con số thống kê, mức lương IT hiện nay ở Việt Nam đạt ngưỡng 15 đến 30 triệu / tháng. Con số đó không phải là không chính xác. Nhưng đó là mức lương của các developer đã có kinh nghiệm. Sau đây là mức lương IT trung bình mình tổng hợp được tại Hà Nội năm 2016. [  174 more words. ] \n\nhttp://khactung.com/knowledge/muc-luong-develop-nam-2016/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('168', '29', 'http://khactung.com/knowledge/phan-40-nguoi-dan-ong-ten-k/', null, '585045091618736_848957738560802', '2016-04-20 13:16:34', 'Chuyện quái quỷ gì vậy? Mọi người xung quanh có vẻ như chưa nhận ra Kai bị tấn công. Thằng bé vẫn cố gắng để chưa gục xuống, anh ra dấu cho mọi người, dòng người chen lấn đang dần dãn ra. Roller kiểm tra vết thương, nó khá nặng, nhưng may mắn là chưa bị vào vị trí nguy hiểm. [  536 more words. ] \n\nhttp://khactung.com/knowledge/phan-40-nguoi-dan-ong-ten-k/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('169', '29', 'http://khactung.com/knowledge/phan-39-dau-hieu-dong-xu/', null, '585045091618736_848957411894168', '2016-04-20 13:16:22', 'Anh nhớ rõ rằng những đồng xu đó không có gì đặc biêt, mỗi lần anh nhớ nhà, hay mỗi khi rảnh rỗi, anh vẫn thường cầm nó quan sát. Vậy thì lý do nào người đàn ông này đổi lấy nó với con chip bảo mật. Câu hỏi cứ quanh quẩn quanh đầu roller, kai sau khi được chuyển tới nhà tiến sỹ một thời gian đã quay lại, hai anh em nó cũng đã lớn, những chừng nào cuộc chiến chưa kết thúc anh vẫn chưa mang lại cho hai đứa nhỏ một gia đình thực sự. [  359 more words. ] \n\nhttp://khactung.com/knowledge/phan-39-dau-hieu-dong-xu/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('170', '29', 'http://khactung.com/knowledge/phan-38-manh-moi/', null, '585045091618736_845358858920690', '2016-04-14 02:34:07', 'Tiếp tục với phần 38: Manh mối Lão xếp mặt đổ phừng, liên tay đập mạnh cái điện thoại, có lẽ lão tưởng nó bị hỏng thứ gì đó. Roller cúi chào và nhanh chóng ra khỏi phòng. Anh cần phải nhanh chóng hoàn thiện nốt các bộ phận nâng cấp cho cái máy tính của mình, nó phải thật mạnh mẽ và đủ bảo mật để phục vụ cho một chặng đường dài sắp tới của anh. [  683 more words. ] \n\nhttp://khactung.com/knowledge/phan-38-manh-moi/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('171', '29', 'http://khactung.com/knowledge/dung-lam-co-gai-cua-anh-bi-ton-thuong/', null, '585045091618736_811214885668421', '2016-02-18 08:50:11', 'ĐỪNG LÀM CÔ GÁI CỦA ANH BỊ TỔN THƯƠNG Anh có thể đôi lúc khiến cô ấy buồn, có thể vì khoảnh khắc nào đấy vô tâm mà khiến cô ấy chịu thiệt thòi hay khổ sở, hoặc thi thoảng trong lúc cáu giận có thể nói một vài câu khiến cô ấy phải khóc. Nhưng, cho dù có như vậy, cũng nhất định đừng bao giờ làm cô ấy bị tổn thương. [  615 more words. ] \n\nhttp://khactung.com/knowledge/dung-lam-co-gai-cua-anh-bi-ton-thuong/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('172', '29', 'http://khactung.com/develop/magento-code-adding-custom-options-in-product/', null, '585045091618736_811214612335115', '2016-02-18 08:48:37', 'Which was used in one of my projects to import product data including custom options. Another solution would be writing a script which could dynamically add custom options to a set of existing products. In this post I will show you how to create such script. The available properties are as follows: title – the option’s label; type – option type, possible values: … [  508 more words. ] \n\nhttp://khactung.com/develop/magento-code-adding-custom-options-in-product/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('173', '29', 'http://khactung.com/develop/magento-recoverable-error-argument-1-passed-to-mage_core_model_store-setwebsite-must-be-an-instance-of-mage_core_model_website/', null, '585045091618736_811213072335269', '2016-02-18 08:41:12', 'It looks like that this problems appears most of users. There are some recommended fix too: 1: Delete following file: app/etc/use_cache.ser 2: Update database with following query: SET FOREIGN_KEY_CHECKS=0; UPDATE `core_store` SET store_id = 0 WHERE code=\'admin\'; UPDATE `core_store_group` SET group_id = 0 WHERE name=\'Default\'; UPDATE `core_website` SET website_id = 0 WHERE code=\'admin\'; UPDATE `customer_group` SET customer_group_id = 0 WHERE customer_group_code=\'NOT LOGGED IN\'; SET FOREIGN_KEY_CHECKS=1; [  527 more words. ] \n\nhttp://khactung.com/develop/magento-recoverable-error-argument-1-passed-to-mage_core_model_store-setwebsite-must-be-an-instance-of-mage_core_model_website/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
INSERT INTO `post_facebooks` VALUES ('174', '29', 'http://khactung.com/knowledge/chuyen-cai-bung-bau-cua-vo/', null, '585045091618736_796887093767867', '2016-01-19 18:34:01', 'Đang làm việc, nhận được điện thoại của vợ. Đầu dây bên kia giọng thẽ thọt: \"Anh ơi, sắp làm bố rồi nhé…!\". Mất hai giây định thần, gã rú lên, chạy vòng quanh văn phòng rồi bế bổng cả sếp lên định công kênh… Gã nhẹ nhàng đặt sếp xuống, ngượng ngùng giải thích: \"Mất 3 năm em mới tự giúp mình, giúp vợ và được lên chức\". [  1209 more words. ] \n\nhttp://khactung.com/knowledge/chuyen-cai-bung-bau-cua-vo/', null, '2016-11-08 10:40:16', '2016-11-08 10:40:16');
