INSERT INTO `post_facebooks` VALUES ('305', '6', 'https://www.facebook.com/OnepieceAnimationProduction/posts/354115764778462:0', 'https://scontent.xx.fbcdn.net/v/t1.0-0/s130x130/11214062_354115764778462_9026272390659291871_n.jpg?oh=35e13a970c572eb5456f805578775e55&oe=58D2C395', '353850508138321_354115764778462', '2015-05-17 18:39:49', '‘One Piece’ Chapter 785 Spoilers: Doflamingo’s Devil Fruit Awakens! Luffy Unleashes His Ace Attack!\nFinally, after a week of delay, \"One Piece\" chapter 785 spoilers are here! Donquixote Doflamingo is about to unveil his devil fruit \"awakening\" while Luffy will try to stop him in one attack! Watch it all unravel here!\nHere\'s the \"One Piece\" chapter 785 spoilers courtesy of Rio Poneglyph quoted from Manga Spoiler:\n\"Birdcage continues shrinking; the people of Dressrosa are in despair.\n- Devil Fruit users like Luffy are merely beginners, Devil Fruits have a level of \'awakening\' (Crocodile mentioned this in Impel Down). When a Devil Fruit is awakened, the user is able to let the objects around them have the same ability.\n- Doffy turns objects around him into strings, Luffy is surprised at this.\n- Doffy uses a powerful technique on Luffy\n- Scene changed. Riku is trying to raise the spirit of the citizens and people on Dressrosa, to not give up and hang on.\n- Everyone hopes Luffy can defeat Doffy.\n- Times running out, Luffy is about to use a technique to bring everything to an end.\n- Luffy uses \'Kamehameha\' pose and shouts out the name of that technique... \"\'Lion Bazooka!\'\"\nFor those who missed \"One Piece\" chapter 784, here\'s the synopsis of the previous chapter .\n\"All citizens of Dressrosa are trying to avoid the shrinking bird cage of Doflamingo. The scene switches to Law and Cavendish. It appears that Law\'s arm is almost healed and Cavendish told him that after all of this, the New World will be in turmoil and they will be caught in the middle of it. Law responds, \'that\'s what we wanted,\'\" as stated in our previous report.\n\"Luffy uses his armanent haki in his arm and blew some air in it, calling it muscle balloon. Then, he transforms his body to an enormous physique and he shouts, \"gear fourth: bound man\" (see photo above). Doflamingo laughs at what he sees as he prepares for Luffy\'s incoming attack. Doffy was surprised to see Luffy\'s arm go inside him like a cannon, and upon impact, he was sent flying back to the city. He was so shocked by Luffy\'s immense power but before he can recover, Luffy was right beside him and delivers a kick to the face and called the attack \'Rhino Shneider.\'\"\n\"Doffy was so pissed at having a hard time disposing a mere rubber man. As Luffy nears him, he avoids Luffy\'s attack and delivers a kick to his ribs, but to no avail. Then, the attack Luffy unleashed was a homing fist and still hit Doflamingo in the face.\"', 'photo', '2016-11-16 03:30:03', '2016-11-16 10:30:03');
INSERT INTO `post_facebooks` VALUES ('306', '6', 'https://www.facebook.com/OnepieceAnimationProduction/posts/353972244792814', 'https://external.xx.fbcdn.net/safe_image.php?d=AQCTrqL06zID_vZ6&w=130&h=130&url=http%3A%2F%2Fi.ytimg.com%2Fvi%2FzWO_ibH6ydY%2Fmaxresdefault.jpg&cfs=1', '353850508138321_353972244792814', '2015-05-17 11:48:27', 'One piece 694 Preview english sub HD\nhttps://goo.gl/u8S8x5', 'video', '2016-11-16 03:30:03', '2016-11-16 10:30:03');
INSERT INTO `post_facebooks` VALUES ('307', '6', 'https://www.facebook.com/OnepieceAnimationProduction/posts/353963191460386', 'https://scontent.xx.fbcdn.net/v/t1.0-0/s130x130/11054782_353963048127067_7879170473138804692_n.jpg?oh=ed9e6bbe9e13d5530236d0744f8efaab&oe=58900BA2', '353850508138321_353963191460386', '2015-05-17 10:47:53', 'Luffy coats his arm in Busoshoku Haki before biting into his forearm. Similar to how he activates Gear Third, he blows an incredible amount of air into his body, but this time he inflates his muscular structure before distributing the air throughout his body, with emphasis on his upper half.\nLuffy\'s proportions become warped and his body becomes much larger in size, with his arms, upper torso, and legs coated in Busoshoku Haki. The coating across his torso resemble the wispy ends made from flames, giving it the appearance of tattoos, and he also gains shading around the inner and outer edges of his eyes. As a side-effect, he is incapable of standing still on the ground, and instead constantly bounces on the spot. This form was created in order to combat the many powerful and large animals on Rusukaina. This form (except for the hardened Busoshoku Haki \'tattoos\', the enlarge biceps and a more rounded torso) resembles his appearance when he became Nightmare Luffy due to Luffy\'s increased muscle size, haircut\'s shape and sinister expression.\nGear Fourth Air Bounce\nLuffy\'s arm changes direction in midair.\nWhile Luffy is using Gear Fourth, his physical strength and speed are increased to the point where he is able to overwhelm a member of the Shichibukai, Donquixote Doflamingo, whereas before Gear Second\'s speed and Gear Third\'s power were ineffective in the fight. Unlike the previous forms, Gear Fourth focuses on compression more than stretching. While the compression grants Luffy\'s moves overwhelming speed and power, the range of his attacks is severely decreased, though he can deliver long-ranged attacks by stretching the part of the body he wants to attack with while retaining great power and speed, as his body is still greater in size and covered in Busoshoku Haki. Luffy also shows a much more versatile side of the Gomu Gomu no Mi\'s powers by changing the direction of his attacks mid-strike to hit a moving opponent without losing momentum.\nGear Fourth Bounciness\nDoflamingo\'s kick bounces off of Luffy.\nAccording to Doflamingo, the power of Luffy\'s attacks is greatly magnified in this form. His durability is also enhanced: despite being hardened with Busoshoku Haki, his body is still rubbery, so physical blows (even ones enhanced with Busoshoku Haki) simply bounce off of him.\n\nThis form, much like Gear Second, seems to utilize the principles of Rokushiki. It possesses both high speed movement reminiscent of Soru and the ability to kick off the air, similar to Geppo, cleverly adapted to work even better with his body\'s elasticity: Luffy not only bounces off the air, but allows attacks to bounce off his own body. His body is also now strong enough to defend against cutting attacks head-on.\n\nHowever, there appears to be a limit to how long Luffy can keep Gear Fourth active, as noted by both Luffy himself and Doflamingo. Once this limit is reached, Gear Fourth is automatically deactivated, and Luffy is left lying exhausted on the ground, barely able to move. He is also left unable to use Haki for ten minutes after using this technique.', 'photo', '2016-11-16 03:30:03', '2016-11-16 10:30:03');
